import React, { useEffect, useState } from "react";
import "./Inventory.css";

// Firebase v9+ modular import
import { initializeApp } from "firebase/app";
import { getDatabase, ref, onValue } from "firebase/database";

// Your Firebase configuration
const firebaseConfig = {
  apiKey: "YOUR_API_KEY",
  authDomain: "YOUR_PROJECT_ID.firebaseapp.com",
  databaseURL: "https://foodai-7ebf0-default-rtdb.firebaseio.com",
  projectId: "YOUR_PROJECT_ID",
  storageBucket: "YOUR_PROJECT_ID.appspot.com",
  messagingSenderId: "YOUR_SENDER_ID",
  appId: "YOUR_APP_ID",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const database = getDatabase(app);

const Inventory = () => {
  // State to store inventory data and loading/error states
  const [inventory, setInventory] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch data from Firebase Realtime Database
    const inventoryRef = ref(database, "/");

    // Set up a real-time listener for changes in the data
    const handleData = (snapshot) => {
      try {
        const data = snapshot.val();
        if (data) {
          // Map the data to an array of categories and items
          const formattedInventory = Object.keys(data).map((category) => ({
            category,
            items: Object.keys(data[category]).map((itemName) => ({
              name: itemName,
              quantity: data[category][itemName].count,
              expiry: data[category][itemName].exp_date,
            })),
          }));
          setInventory(formattedInventory);
        } else {
          // Handle case when no data is found
          setInventory([]);
        }
      } catch (err) {
        setError("Failed to fetch data from Firebase: " + err.message);
      } finally {
        setLoading(false); // Set loading to false once the data is fetched or an error occurs
      }
    };

    onValue(inventoryRef, handleData, (error) => {
      setError("Error fetching data from Firebase: " + error.message);
      setLoading(false); // Stop loading on error
    });

    // Clean up the listener on unmount
    return () => {
      setLoading(true); // Reset loading state when component unmounts
      setError(null); // Reset any previous errors
    };
  }, []);

  // Conditional rendering based on loading and error states
  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="inventory-container">
      <div className="inventory-header">
        <h1>INVENTORY</h1>
      </div>
      <div className="inventory-content">
        <table className="inventory-table">
          <thead>
            <tr>
              <th>Type of Food</th>
              <th>Food Item</th>
              <th>Quantity</th>
              <th>Expiry Date</th>
            </tr>
          </thead>
          <tbody>
            {inventory.length > 0 ? (
              inventory.map((category) =>
                category.items.length > 0 ? (
                  category.items.map((item, index) => (
                    <tr key={`${category.category}-${index}`}>
                      {index === 0 && (
                        <td rowSpan={category.items.length}>{category.category}</td>
                      )}
                      <td>{item.name}</td>
                      <td>{item.quantity}</td>
                      <td>{item.expiry || "N/A"}</td> {/* Display 'N/A' if expiry date is empty */}
                    </tr>
                  ))
                ) : (
                  <tr key={category.category}>
                    <td rowSpan="1">{category.category}</td>
                    <td colSpan="3">[empty]</td>
                  </tr>
                )
              )
            ) : (
              <tr>
                <td colSpan="4" style={{ textAlign: "center" }}>
                  No inventory data available.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Inventory;
